package Loops;

import java.util.*;

public class f8 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		System.out.println("Enter The Number to Print table ::");
		int n=sc.nextInt();
		for(int i=1;i<=10;i++)
		{
			System.out.println(i*n);
		}
	}

}
